import Login from "./Login"
function Navbar () {
    function showLogin(e, id) {
        e.preventDefault()
        return <Login />
    }

    return(
        <nav className="container">
            <button onClick={showLogin(e, id)} href="/signup" className="u-pull-right button-primary">Signup</button>
            <button onClick={showLogin} href="/login" className="u-pull-right">Login</button>
        </nav>
    )
}

export default Navbar;
